import React from "react";
import {Col, Row} from "react-bootstrap";


const Login = (props) =>{
    let state = props.loginPage
    return(
        <Row>
            <Col xs='12'><h1>Login In</h1></Col>
            <Col xs='12'>
                <Row>
                    <Col xs='12'><textarea name="" id="" value={state.email} placeholder='Введите свою почту'></textarea></Col>
                    <Col xs='12'><textarea name="" id="" value={state.password} placeholder='Введите пароль'></textarea></Col>
                </Row>
            </Col>
        </Row>

    )
}

export default Login
